import React from 'react';
import { BrowserRouter as Router, Routes, Route } from 'react-router-dom';
import './assets/css/App.css';
// Importera din login-sida
import Login from './pages/Login';

function App() {
  return (
    <Router>
      <Routes>
        <Route path="/login" element={<Login />} />
        {/* Lägg till fler routes senare */}
        <Route path="/" element={
          <div className="App">
            <header className="App-header">
              <p>Welcome to the homepage! (lägg in komponenter här sen)</p>
            </header>
          </div>
        } />
      </Routes>
    </Router>
  );
}

export default App;
